	 (2,'12/06/2024','Pont ferroviaire International Irun-Hendaye Pont ferroviaire International Irun-Hendaye','AY0024',NULL,NULL,NULL,NULL,NULL,NULL,'DP06426024B0153','EUSKAL TRENBIDE SAREA','EUSKAL TRENBIDE SAREA','Ernesto ','Nº 8  Planta 14 calle San Vicente','48001','Bilbao','EUSKAL TRENBIDE SAREA EUSKAL TRENBIDE SAREA - Martínez de Cabredo Arrieta Ernesto','','','','','Réhabilitation urgente du Pont ferroviaire International d''Irun-Hendaye<br/><br/>Vu l’état de dégradation, calcification des pierres, fissures dues au tassements des piles, instabilité des fondations, suite à l''étude de sa capacité portante, la réhabilitation et renforcement du pont sont nécessaires. <br/>Compte tenu de leur situation instable, le renforcement des fondations présente un caractère urgent.<br/>Dans les fondations des piles du pont l’on détecte de grandes cavités et affouillements atteignant 3m sous les semelles. <br/>À cause de l''affouillement, les pieux en bois sont exposés aux attaques d''organismes xylophages, aux marées à coefficient élevé, à la pourriture, et présentent une perte de section, discontinuités, manque d''encastrement en semelle. <br/>La reprise en sous-œuvre des fondations revêt un caractère urgent, afin d''éviter de graves dommages, un possible effondrement. <br/>Le projet propose de nouvelles semelles périmétriques de renfort sur micropieux autour des fondations existantes, transférant les charges des piles vers les nouvelles fondations renforcées.<br/>',0.0,0.0,'06/06/2024','07/06/2024',NULL,NULL,NULL,3,'2024-06-06','64260'),
